const TableBody = ({data, columns}) => {
  return (
    <>
      <tbody>
        {data.map((row) => {
          return (
            <>
              <tr>
                  {
                      columns.map(col => {
                          return (
                             col.content(row[col.id]) 
                          )
                      })
                  }
              </tr>
            </>
          );
        })}
      </tbody>
    </>
  );
};

export default TableBody;
